export default {
  hr: {
    info: [
      'Turističko središte otoka Paga, poznato ljetovalište i odredište brojnih turista, nudi mogućnost aktivnog i sadržajnog odmora',
      'Ima dugu i bogatu prošlost o čemu svjedoče brojni ostaci antičkih građevina, a jedan od najpoznatijih je jedinstveni antički vodovod isklesan u živom kamenu iz 1. stoljeća',
      '13/06-blagdan Sv. Antona, koji se ujedno slavi kao Dan grada Novalje, smatra se i početkom Novaljskog kulturnog ljeta u sklopu kojeg se organiziraju brojni kulturno-umjetnički i zabavni sadržaji'
    ]
  },
  en: {
    info: [
      'Novalja is a tourist center of Island of Pag. Well known resort town and destination of many tourist, offers possibilities of active and meaningful vacation',
      'Novalja has a long an abundant history, there are many ancient & unique remains of that past. One of the best known is ancient Aqueduct from the 1st century',
      'Dan 13. lipnja - blagdan Sv. Antona, koji se ujedno slavi kao Dan grada Novalje, smatra se i početkom Novaljskog kulturnog ljeta u sklopu kojeg se organiziraju brojni kulturno-umjetnički i zabavni sadržaji'
    ]
  },
  cs: {
    info: [
      'Novalja – turistické středisko ostrova Pag, známé letovisko a místo četných turistů, nabízí možnost aktivního odpočinku s mnoha možnostmi',
      'Novalja má dlouhou a bohatou minulost o čemž svědčí četné pozůstatky antických staveb. Jednou z nejznámějších je jedinečný antický vodovod z 1. století, vytesán do živého kamene',
      'Den 13. červen - svátek Sv. Antona, který se zároveň slaví jako Den města Novalje, je považován za počátek Novaljského kulturního léta, v rámci kterého jsou organizovány četné kulturně-umělecké a zábavní akce'
    ]
  },
  de: {
    info: [
      'Novalja – das Tourismuszentrum der Insel Pag, Bekannter Ferienort und Ziel von vielen Touristen, bietet die Möglichkeit eines aktiven und inhaltlichen Urlaubs',
      'Novalja hat eine lange und reiche Vergangenheit, davon zeugt eine Vielzahl von Resten antiker Bauwerke. JEiner der bekanntesten ist die einzigartig Wasserleitung, die in Stein gemeißelt wurde aus dem ersten Jahrhundert',
      'Der 13. Juni – heiliger Antonius, der gleichzeitig als Tag der Stadt Novalja gefeiert wird, wird als Beginn der Kulturtage im Sommer in Novalja gewertet. Während dieser Kulturtage werden viele Kultur- und Kunstmanifestationen sowie Unterhaltungsinhalte organisiert'
    ]
  },
  it: {
    info: [
      "Novalja - centro turistico dell'isola di Pag, famoso luogo di villegiatura e meta di numerosi turisti, offre numerose possibilità di riposo attivo e pieno di contenuti",
      "La storia di Novalja è lunga e ricca. Lo testimoniano numerosi resti che risalgono alle costruzioni dell'antichità. Uno dei più famosi resti è l'antico acquedotto scolpito in pietra viva risalente al primo secolo dopo Cristo",
      "Il 13 giugno, giorno di Sant'Antonio, festa patronale della città di Novalja, inizia la manifestazione denominata Estate culturale di Novalja nell'arco della quale si tengono numerose manifestazioni artistico-culturali e di varietà"
    ]
  },
  sl: {
    info: [
      'Novalja - turistično središče otoka Paga, poznato letovališče in destinacija številnih turistov, ponuja mogočnost aktivnega in sadržajenga odmora',
      'Novalja ima dolgo in bogato zgodovino o katerej svedoče tudi številni ostanki antičnih gradišč. Ena od najbolj znanih je edinstven antički vodovod izklesan v živem kamnu iz 1. stoletja',
      'Dan 13. junija - praznik Sv. Antona, kateri se tudi praznuje kot Dan mesta Novalje, drži se tudi začetkom Novaljskega kulturnega leta v sklopu katerega se organizirajo številni kulturno-umetniški in zabavni sadržaji'
    ]
  }
}
